"       Trade name",
"      </td>",
"      <td class=\"subtitle1\">",
"       Dose",
"      </td>",
"      <td class=\"subtitle1\">",
"       Route of administration",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Goserelin acetate",
"      </td>",
"      <td>",
"       Zoladex",
"      </td>",
"      <td>",
"       3.6 milligrams every 28 days",
"      </td>",
"      <td>",
"       Subcutaneous",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"2\">",
"       Leuprolide acetate",
"      </td>",
"      <td rowspan=\"2\">",
"       Lupron",
"      </td>",
"      <td>",
"       3.75 milligrams once per month",
"      </td>",
"      <td>",
"       Intramuscular",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       11.25 milligrams every three months",
"      </td>",
"      <td>",
"       Intramuscular",
"      </td>",
