var title_f5_10_5292="Antiemetics by etiology";
var content_f5_10_5292=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F78749&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F78749&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Selection of antiemetics by clinical situation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Situation",
"       </td>",
"       <td class=\"subtitle1\">",
"        Associated neurotransmitters",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommended antiemetic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Migraine headache",
"       </td>",
"       <td rowspan=\"2\">",
"        Dopamine (probably a primary mediator)",
"       </td>",
"       <td>",
"        For headache and nausea: metoclopramide (reglan) or prochlorperazine (compazine)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        For nausea: oral antiemetics, metoclopramide, prochlorperazine, serotonin antagonists",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Vestibular nausea",
"       </td>",
"       <td>",
"        Histamine, acetylcholine",
"       </td>",
"       <td>",
"        Antihistamines and anticholinergics (equally effective)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        Pregnancy-induced nausea",
"       </td>",
"       <td rowspan=\"2\">",
"        Unknown",
"       </td>",
"       <td>",
"        For nausea: ginger, vitamin B6",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        For hyperemesis gravidarum: promethazine (phenergan, first-line agent); serotonin antagonists and corticosteroids (second-line agents)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        Gastroenteritis",
"       </td>",
"       <td rowspan=\"3\">",
"        Dopamine, serotonin",
"       </td>",
"       <td>",
"        First-line agents: dopamine antagonists",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Second-line agents: serotonin antagonists",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Use in children is controversial",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        Postoperative nausea and vomiting",
"       </td>",
"       <td rowspan=\"2\">",
"        Dopamine, serotonin",
"       </td>",
"       <td>",
"        Prevention: serotonin antagonists, droperidol (inapsine), dexamethasone",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Treatment: dopamine antagonists, serotonin antagonists, dexamethasone",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Flake ZA, Scalley RD, Bailey AG. Practical selection of antiemetics. Am Fam Physician 2004; 69:1169.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
