var title_f5_10_5294="Alosetron and IBS";
var content_f5_10_5294=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F70978&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F70978&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 518px\">",
"   <div class=\"ttl\">",
"    Benefit of alosetron in diarrhea-predominant IBS",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 498px; height: 289px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Results of a controlled trial of 647 women with irritable bowel syndrome (IBS) that was either diarrhea-predominant or had alternating diarrhea and constipation. The women were randomly assigned to alosetron (1 mg twice daily) or placebo for 12 weeks. A significantly greater proportion of women treated with alosetron (41 verses 29 percent with placebo) described adequate relief for all three months of therapy. This difference disappeared with cessation of therapy.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Camilleri, M, Northcutt, AR, Kong, S, et al. Lancet 2000; 355:1035.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
